import React from "react";
import image1 from "./images/novice.png"

function Card(props) {
    console.log(props)
    

    return (

    <div className="card">
        <img src={image1} alt ="Loading!" />
        <div className = "card-body">
            <h4 className="card-title"> My Title </h4>
        <p className = "card-text text-secondary">Hello!</p>
        <a href ="#!" className="btn btn-outline-secondary rounded-0">
            Go to this! 
        </a>
        </div>
    </div>
    )
}

export default Card;
